import React from 'react'

const menu = [
    {
        first: Studio
    },
    {
        second: Partners
    },
    {
        third: Media
    },
    {
        fourth: user
    }
]

export const Menu = () => {
    return (
        <li>
            {menu}
        </li>
    )
}

export default Menu;
